import React from "react";
import { Link } from "react-router-dom";
import './HomePage.css';

const brands = [
  { id: 1, title: "Audi" },
  { id: 2, title: "BMW" },
  { id: 3, title: "Mercedes" },
];

function HomePage() {
  return (
    <div className="homepage">
      <h1>Марки автомобилей</h1>
      <div className="brand-list">
        {brands.map((brand) => (
          <Link to={`/brand/${brand.title}`} key={brand.id}>
            <div className="brand-item">{brand.title}</div>
          </Link>
        ))}
      </div>
    </div>
  );
}

export default HomePage;
